import React from 'react'
// import { motion } from 'framer-motion'
import { Link } from 'react-scroll'

const NavLinks = (props) => {
    // const animationFrom = { opacity: 0, y: -40 }
    // const animateTo = { opacity: 1, y: 0 }

    return (
        <div className='menu'>
            <Link
                className='nav-li'
                activeClass="active"
                to="home"
                spy={true}
                smooth={true}
                offset={-100}
                duration={500}
                className="nav-link"
            >Home</Link>
            <Link
                activeClass="active"
                to="about"
                spy={true}
                smooth={true}
                offset={-100}
                duration={500}
                className="nav-link"
            >About</Link>
            <Link
                activeClass="active"
                to="skills"
                spy={true}
                smooth={true}
                offset={-100}
                duration={500}
                className="nav-link"
            >Skills</Link>
            <Link activeClass="active"
                to="about"
                spy={true}
                smooth={true}
                offset={-100}
                duration={500}
                className="nav-link"
            >CV</Link>
            <Link activeClass="active"
                to="about"
                spy={true}
                smooth={true}
                offset={-100}
                duration={500}
                className="nav-link"
            >Contact</Link>
        </div>
    );
}

export default NavLinks;
